-- 收藏集工作集数据

-- NFT API数据表结构定义和数据导入

-- 设置执行参数
SET 'execution.checkpointing.interval' = '10s';
SET 'table.exec.state.ttl'= '8640000';
SET 'table.local-time-zone' = 'Asia/Shanghai';

/* 创建Paimon Catalog */
CREATE CATALOG paimon_hive WITH (
    'type' = 'paimon',
    'metastore' = 'hive',
    'uri' = 'thrift://192.168.254.133:9083',
    'hive-conf-dir' = '/opt/software/apache-hive-3.1.3-bin/conf',
    'hadoop-conf-dir' = '/opt/software/hadoop-3.1.3/etc/hadoop',
    'warehouse' = 'hdfs:////user/hive/warehouse'
);

USE CATALOG paimon_hive;
CREATE DATABASE IF NOT EXISTS ods;
USE ods;


-- 收藏集工作集
CREATE TABLE IF NOT EXISTS ods_collection_working_set (
    collection_id STRING,
    collection_address STRING,
    collection_name STRING,
    logo_url STRING,
    first_added_date STRING,
    last_updated_date STRING,
    last_active_date STRING,
    source STRING,
    status STRING,
    floor_price DECIMAL(30,10),
    volume_1d DECIMAL(30,10),
    volume_7d DECIMAL(30,10),
    sales_1d BIGINT,
    sales_7d BIGINT,
    update_count INT,
    PRIMARY KEY (collection_id) NOT ENFORCED
) WITH (
    'bucket' = '4',
    'file.format' = 'parquet',
    'merge-engine' = 'deduplicate',
    'changelog-producer' = 'input',
    'compaction.min.file-num' = '3',
    'compaction.max.file-num' = '30',
    'compaction.target-file-size' = '128MB'
);

